import React,{useState} from 'react';
import {ToggleButton,ToggleButtonGroup} from '@mui/material'

export default  function Boolnput(props){
    const {input,config,setConfig,setOutput} = props

    const [value, setValue] = useState(config?.value || "true");
    const handleSwitch = (event) => {
        setValue(event.target.value);
        setConfig({...config,value:event.target.value})
        setOutput({output: event.target.value});
    };
    return (
        <ToggleButtonGroup
        value={value}
        exclusive
        onChange={handleSwitch}
        aria-label="text alignment"
        sx={{
            width: "100%",
            height: "100%",
            minHeight:0
        }}
        >

        <ToggleButton fullWidth value="true">
            True
        </ToggleButton>
        <ToggleButton fullWidth value="false">
            False
        </ToggleButton>

        </ToggleButtonGroup>
    );
}

