import { useEffect} from 'react';

export default function ImageViewer(props){

    const {input,config,setConfig,setOutput} = props

    useEffect(() => {
        if (input && input.input) {
            let img = new Image();
            img.onload = function() {
                setConfig({...config,width: this.naturalWidth/2, height: this.naturalHeight/2});
            }
            img.src = input.input;
        }
    }, [input]);

    return (
        <>
        {input && input.input &&
            <img src={input.input} alt="data" style={{width: "100%"}}/>
        }
        </>
    );
}

