import { Slider, Typography,Box,Stack,TextField } from "@mui/material";
import { useEffect,useState } from "react";


export default function TextInput(props){

    const {input,config,setConfig,setOutput} = props

    const [value, setValue] = useState(config?.value||500);
    const [editable, setEditable] = useState(false);

    const handleChange = (e) => {
        setValue(e.target.value);
        setOutput({output:value});
    }

    const handleSubmit = (e) => {
        setConfig({...config, value:value});
    }

    return (
        <Box sx={{p:1}} width="100%">
            <Stack direction="row" spacing={2} 
            onMouseLeave={handleSubmit}
            sx={{display:"flex", 
            alignItems:"center"
            }}>
            <Slider 
                onChange={handleChange}
                value = {value}
                sx={{marginRight:5}}
                size="small"
                min={0}
                shiftStep={100}
                max={1000}
                step={1}
                // valueLabelDisplay="auto"
            >
            </Slider>
            {
                editable ? 
                <TextField size="small" value={value} 
                    onMouseLeave={()=>setEditable(false)}
                    onChange={handleChange} sx={{width:100}}
                    inputProps={{style: { fontSize: 8 }}}
                    InputLabelProps={{style: { fontSize: 8 }}}
                    autoFocus={true}
                    variant="standard"
                    >
                </TextField>
                :<Typography variant="caption" onDoubleClick={()=>setEditable(!editable)} >{value}</Typography>

            }
            </Stack>

        </Box>
    );
}

